import React from "react";


function Registration() {
    return (
        <div>
            <h1>Sign-up</h1>
            <form action="submit">
                <div>
                    <input type="text" name="fullname" />
                    <label >Full Name</label>
                </div>

            </form>
        </div>
    )
}

export default Registration;
